patch:
diff --git a/icu4c/source/i18n/regexcmp.cpp b/icu4c/source/i18n/regexcmp.cpp
index a4c12804237..23258212688 100644
--- a/icu4c/source/i18n/regexcmp.cpp
+++ b/icu4c/source/i18n/regexcmp.cpp
@@ -70,6 +70,7 @@ RegexCompile::RegexCompile(RegexPattern *rxp, UErrorCode &status) :
     fInBackslashQuote = FALSE;
     fModeFlags        = fRXPat->fFlags | 0x80000000;
     fEOLComments      = TRUE;
+    fNextCharRecursionDepth = 0;

     fMatchOpenParen   = -1;
     fMatchCloseParen  = -1;
@@ -4009,8 +4010,17 @@ UChar32  RegexCompile::peekCharLL() {
 //                The rest of the pattern grammar is handled at the next level up.
 //
 //------------------------------------------------------------------------------
+static const int32_t MAX_NEXTCHAR_RECURSION_DEPTH = 100;
+
 void RegexCompile::nextChar(RegexPatternChar &c) {

+    // Check for excessive recursion to prevent stack overflow
+    if (fNextCharRecursionDepth >= MAX_NEXTCHAR_RECURSION_DEPTH) {
+        error(U_REGEX_INTERNAL_ERROR);
+        return;
+    }
+    fNextCharRecursionDepth++;
+
     fScanIndex = UTEXT_GETNATIVEINDEX(fRXPat->fPattern);
     c.fChar    = nextCharLL();
     c.fQuoted  = FALSE;
@@ -4020,7 +4030,8 @@ void RegexCompile::nextChar(RegexPatternChar &c) {
         if ((c.fChar==chBackSlash && peekCharLL()==chE && ((fModeFlags & UREGEX_LITERAL) == 0)) ||
             c.fChar == (UChar32)-1) {
             fQuoteMode = FALSE;  //  Exit quote mode,
-            nextCharLL();        // discard the E
+            if (c.fChar != (UChar32)-1)
+                nextCharLL();        // discard the E
             nextChar(c);         // recurse to get the real next char
         }
     }
@@ -4156,6 +4167,7 @@ void RegexCompile::nextChar(RegexPatternChar &c) {
     // They are disabled by the parser upon seeing '(?', but this lasts for
     //  the fetching of the next character only.
     fEOLComments = TRUE;
+    fNextCharRecursionDepth--;

     // putc(c.fChar, stdout);
 }
diff --git a/icu4c/source/i18n/regexcmp.h b/icu4c/source/i18n/regexcmp.h
index f2aeea909e7..8e787d71dcb 100644
--- a/icu4c/source/i18n/regexcmp.h
+++ b/icu4c/source/i18n/regexcmp.h
@@ -149,6 +149,7 @@ class U_I18N_API RegexCompile : public UMemory {
     UChar32                       fLastChar;         // Previous char, needed to count CR-LF
                                                      //   as a single line, not two.
     UChar32                       fPeekChar;         // Saved char, if we've scanned ahead.
+    int32_t                       fNextCharRecursionDepth; // Recursion depth counter for nextChar()


     RegexPatternChar              fC;                // Current char for parse state machine
